import './App.css';
import Navbar from './Components/Navbar';
import Userlog from './Components/Users/Login';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import UserSignup from './Components/Users/Signup';
import Driverlog from './Components/Driver/Login';
import DriverSignup from './Components/Driver/Signup';
import Vehicleinfo from './Components/Driver/Vehicleinfo';
function App() {

  return (
    <>
    <Router>
      <Navbar/>
      <br></br>
      <br></br>
      <br></br>
      <Switch>
          <Route exact path="/User-Login">
            <Userlog/>
          </Route>
          <Route exact path="/Driver-Login">
            <Driverlog/>
          </Route>
          <Route exact path="/User-Signup">
            <UserSignup/>
          </Route>
          <Route exact path="/Driver-Signup">
            <DriverSignup/>
          </Route>
          <Route exact path="/Driver-Signup/Driver-Vehical-infromation">
            <Vehicleinfo/>
          </Route>
        </Switch>

      </Router>
    </>
  );
}

export default App;
